import { request } from "./request.js";

export const saveservice = async (token, type, name, annotation, cost, idtype, idsupertype) => {

  const formData = {"token": token,
                    "data": {
                        "type": type, 
                        "name": name, 
                        "annotation": annotation, 
                        "cost": cost, 
                        "type_id": idtype,
                        "super_type_id": idsupertype}};
  const path = '/api/admin/create';

  return request(path, formData)

};
